    return <div>
    {props.name === props.curr ?(
        <tr>
            <td class="names">{props.name}</td>
            <td class="names">{props.rank}</td>
        </tr>
       ): 
        <tr>
            <td>{props.name}</td>
            <td>{props.rank}</td>
        </tr>
    }
    </div>
}
